import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { StudentSsoFeePaymentComponent } from './student-sso-fee-payment.component';

const routes: Routes = [{ path: '', component: StudentSsoFeePaymentComponent }];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class StudentSsoFeePaymentRoutingModule { }
